import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpense/NewExpense";

const App = () => {
  const expenses = [
    {
      id: 1,
      title: 'Python',
      amount: 40.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 2,
      title: 'Go',
      amount: 30.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 3,
      title: 'React',
      amount: 60.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 4,
      title: 'Django',
      amount: 80.9,
      date: new Date(2021, 2, 28)
    }
  ];

  return (
    <div>
    <NewExpense/>
    <Expenses items= {expenses} />
    </div>
  );

}

export default App;
